import React, { useState } from "react";
import "../node_modules/bootstrap/dist/css/bootstrap.min.css";
import Card from "./Card";
import Sdata from "./Sdata";


const App = () =>{

    const img = " asese"; 
    const title = "ewr ";
    const links = "http://www.lushfashionhub.com";
    const linkCon = "Go somewhere";
    const altcon = "images";
    
    return(
        <>
        <h1 className="text-center m-5 text-danger">Hello All!</h1>
        <div className="container">
        <div className="row">
            <Card  
            images={Sdata[0].images}
            title = {Sdata[0].title}
            links = {Sdata[0].links}
            name = {Sdata[0].name}
            />

        <Card  
           images={Sdata[1].images}
            title = {Sdata[1].title}
            links = {Sdata[1].links}
            name = {Sdata[1].name}
            />

        <Card  
            images={Sdata[2].images}
            title = {Sdata[2].title}
            links = {Sdata[2].links}
            name = {Sdata[2].name}
            />
        { Sdata.map((val)=>{

           return <Card  
            images={val.images}
            title = {val.title}
            links = {val.links}
            name = {val.name}
            />

        })}

            
        </div>
        </div>
       

   </>     
 );    
};
export default App;
